import React, { Component } from "react";


export default class CreateStudent extends Component {





    render() { 
        return ( 
            <form>
            <h3>Sign Up</h3>

            <div className="form-group">
                <label>First name</label>
                <input type="text" className="form-control" placeholder="Enter Nname" />
            </div>



            <div className="form-group">
                <label>Email address</label>
                <input type="email" className="form-control" placeholder="Enter email" />
            </div>

            <div className="form-group">
                <label>Password</label>
                <input type="number" className="form-control" placeholder="Enter Roll Number" />
            </div>

            <button type="submit" className="btn btn-primary btn-block">Create Student</button>

        </form>
        )
    }
}
